// src/components/FinalScreen.js
import React from 'react';
import productImg from '../assets/h (1).png'; // Asegúrate de que la imagen esté en la carpeta assets

function FinalScreen() {
  return (
    <div className="final-screen" style={{ textAlign: 'center', padding: '40px' }}>
      <h1>¡Gracias por completar el cuestionario!</h1>
      <p>Basándonos en tus respuestas, te recomendamos el siguiente producto:</p>
      <img 
        src={productImg} 
        alt="Producto Recomendado" 
        className="product-image" 
        style={{ maxWidth: '100%', height: 'auto', marginTop: '20px' }} 
      />
    </div>
  );
}

export default FinalScreen;
